import React from 'react'
import {NavLink} from 'react-router-dom'

const SignedInLinks = () =>  {
    return ( 
      <li className="nav-item dropdown">
        <a className="nav-link dropdown-toggle" href="#" id="dropdown01" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false"><i className="fas fa-user mr-2"></i>Biprodas</a>
        <div className="dropdown-menu" aria-labelledby="dropdown01">
          <a className="dropdown-item" href="#"><i className="fas fa-user mr-1"></i>My Profile</a>
          <a className="dropdown-item" href="#"><i className="fas fa-cog mr-1"></i>Setting</a>
          <a class="dropdown-item" href="#"><i className="fas fa-sign-out-alt mr-1"></i>Log out</a>
        </div>
      </li>
    );
}
 
export default SignedInLinks;
